import './App.css';
import { AllCategories } from './Components/FilterComponent/AllCategories';
import { Cart } from './Components/CartComponent/Cart';
import { Goods } from './Components/GoodsComponent/Goods';

function App() {
  return (
    <div className="App">
          <AllCategories />
          <div className="content">
          <div className="cartBlock">
            <Cart />
          </div>
          <div className="goodsBlock">
            <Goods />
          </div>
        </div>
    </div>
  );
}

export default App;
